import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <nav className="bg-blue-600 p-4 flex justify-between items-center">
      <div className="text-white font-bold text-xl">
        <Link to="/">SyncHUB</Link>
      </div>
      <ul className="flex space-x-4">
        {user ? (
          <>
            <li><Link to="/dashboard" className="text-white hover:text-blue-200">Dashboard</Link></li>
            <li><Link to="/sync" className="text-white hover:text-blue-200">Sync</Link></li>
            <li><Link to="/profile" className="text-white hover:text-blue-200">Profile</Link></li>
            <li><button onClick={handleLogout} className="text-white hover:text-blue-200">Logout</button></li>
          </>
        ) : (
          <>
            <li><Link to="/login" className="text-white hover:text-blue-200">Login</Link></li>
            <li><Link to="/register" className="text-white hover:text-blue-200">Register</Link></li>
          </>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
